import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

// components
import Header from './Header';
import Main from './Main';

function App() {
  return (
    <div className="container-fluid">
      <Header />  
      <Main />
      <footer>
        <div className="col">
          <div className="title-underline"></div>
        </div>
      </footer>
    </div>
  );
}

export default App;
